
import jsPDF from "jspdf";
import autoTable from "jspdf-autotable";

/* ======================================================
   APPLICATION LOGO (BASE64 IMAGE)
   ------------------------------------------------------
   üëâ HOW TO USE:
   1. Convert your logo image to Base64 using:
      https://base64.guru/converter/encode/image

   2. Copy the FULL string that starts with:
      data:image/png;base64,...

   3. PASTE the Base64 string below INSIDE the quotes.

   ‚ö†Ô∏è IMPORTANT:
   - Do NOT remove `data:image/png;base64,`
   - Do NOT add spaces or line breaks
   - PNG with transparent background works best
====================================================== */
const APP_LOGO_BASE64 =
  "";

export const generateTransactionsPDF = (taskName, transactions, summary) => {
  const doc = new jsPDF();
  const pageWidth = doc.internal.pageSize.getWidth();
  const pageHeight = doc.internal.pageSize.getHeight();

  /* =========================
     CALCULATE SUMMARY (use passed summary or calculate)
  ========================= */
  let totalCredit = 0;
  let totalDebit = 0;
  let balance = 0;

  if (summary) {
    // Use the passed summary object
    totalCredit = summary.totalCredit || summary.credit || 0;
    totalDebit = summary.totalDebit || summary.debit || 0;
    balance = summary.balance || 0;
  } else {
    // Calculate from transactions
    transactions.forEach((t) => {
      if (t.type === "credit") totalCredit += t.amount;
      if (t.type === "debit") totalDebit += t.amount;
    });
    balance = totalCredit - totalDebit;
  }

  /* =========================
     HEADER
  ========================= */
  if (APP_LOGO_BASE64 && APP_LOGO_BASE64 !== "PASTE_YOUR_BASE64_LOGO_HERE") {
 doc.addImage(
  APP_LOGO_BASE64,
  "PNG",
  25, // X position
  6,  // Y position (closer to heading)
  20, // Width
  20  // Height
);
  }
  doc.setFontSize(20);
  doc.setFont(undefined, "bold");
  doc.text("Task Transactions Report", pageWidth / 2, 20, { align: "center" });

  doc.setFontSize(11);
  doc.setFont(undefined, "normal");
  doc.setTextColor(80);
  doc.text(
    "A detailed record of all financial transactions related to this task.",
    pageWidth / 2,
    28,
    { align: "center" }
  );

  doc.setDrawColor(200);
  doc.line(14, 34, pageWidth - 14, 34);

  /* =========================
     TASK INFO
  ========================= */
  doc.setTextColor(0);
  doc.setFontSize(12);
  doc.setFont(undefined, "bold");
  doc.text("Task Information", 14, 45);

  doc.setFontSize(11);
  doc.setFont(undefined, "normal");
  doc.text(`Task Name: ${taskName}`, 14, 53);
  doc.text(
    `Generated On: ${new Date().toLocaleDateString()}`,
    14,
    60
  );
  doc.text(
    `Total Transactions: ${transactions.length}`,
    14,
    67
  );

  /* =========================
     TRANSACTIONS TITLE
  ========================= */
// Define center position (assuming pageWidth is already defined as in your previous code)
  const centerX = pageWidth / 2;

  // Title
  doc.setFontSize(13);
  doc.setFont(undefined, "bold");
  doc.setTextColor(0, 0, 0); // Ensure title is black
  doc.text("Transaction Details", centerX, 80, { align: "center" });

  // Subtitle
  doc.setFontSize(10);
  doc.setFont(undefined, "normal");
  doc.setTextColor(90); // Grey color
  doc.text(
    "Below is the list of all credit and debit transactions recorded for this task.",
    centerX,
    87,
    { align: "center" }
  );

  /* =========================
     TABLE DATA
  ========================= */
  const tableColumns = ["Date", "Time", "Description", "Type", "Amount"];
  const tableRows = [];

  transactions
    .sort((a, b) => new Date(b.date) - new Date(a.date))
    .forEach((t) => {
      tableRows.push([
        new Date(t.date).toLocaleDateString(),
        t.time || "-",
        t.description || "No description",
        t.type === "credit" ? "Credit" : "Debit",
        `$${t.amount.toFixed(2)}`,
      ]);
    });

  autoTable(doc, {
    startY: 95,
    head: [tableColumns],
    body: tableRows,
    theme: "grid",
    headStyles: {
      fillColor: [79, 70, 229],
      textColor: 255,
      fontStyle: "bold",
    },
    bodyStyles: {
      fontSize: 9,
    },
    columnStyles: {
      2: { cellWidth: 60, overflow: "linebreak" },
      4: { halign: "right" },
    },
    didDrawPage: (data) => {
      doc.setFontSize(8);
      doc.setTextColor(150);
      doc.text(
        `Page ${data.pageNumber}`,
        pageWidth / 2,
        pageHeight - 10,
        { align: "center" }
      );
    },
  });

  /* =========================
     SUMMARY
  ========================= */
  let finalY = doc.lastAutoTable.finalY + 15;

  if (finalY + 50 > pageHeight) {
    doc.addPage();
    finalY = 20;
  }

  doc.setFontSize(13);
  doc.setFont(undefined, "bold");
  doc.setTextColor(0);
  doc.text("Financial Summary", 14, finalY);

  doc.setFontSize(10);
  doc.setFont(undefined, "normal");
  doc.setTextColor(90);
  doc.text(
    "This section shows the overall financial outcome of the task.",
    14,
    finalY + 7
  );

  doc.setDrawColor(220);
  doc.roundedRect(14, finalY + 12, pageWidth - 28, 32, 3, 3);

  doc.setFontSize(11);
  doc.setTextColor(34, 197, 94);
  doc.text(
    `Total Credit: $${totalCredit.toFixed(2)}`,
    20,
    finalY + 24
  );

  doc.setTextColor(239, 68, 68);
  doc.text(
    `Total Debit: $${totalDebit.toFixed(2)}`,
    20,
    finalY + 32
  );

  doc.setFont(undefined, "bold");
  doc.setTextColor(balance >= 0 ? 34 : 239, balance >= 0 ? 197 : 68, balance >= 0 ? 94 : 68);
  doc.text(
    `Balance: $${balance.toFixed(2)}`,
    pageWidth - 20,
    finalY + 32,
    { align: "right" }
  );

  /* =========================
     SAVE
  ========================= */
  const filename = `${taskName.replace(/[^a-z0-9]/gi, "_")}_transactions.pdf`;
  doc.save(filename);
};